INSERT INTO dash_entries VALUES(317,18,4,'Runner Efficiency','Shows how much time of the task runner is spent inside the actual execution of the function.',5,'line','[{"name":"snoop.data.tasks.call_function__duration","alias":"call_function__duration"},{"name":"snoop.data.tasks.laterz_snoop_task__duration","alias":"laterz_snoop_task__duration"}]','per_sec($call_function__duration) / per_sec($laterz_snoop_task__duration)','{"per_sec($call_function__duration) / per_sec($laterz_snoop_task__duration)":{"unit":"percents"}}');
INSERT INTO dash_entries VALUES(318,18,4,'Task Success Ratio','',4,'stacked-area','[{"name":"task_success","alias":"s"},{"name":"task_broken","alias":"b"},{"name":"task_missing_dependency","alias":"m"},{"name":"task_not_found","alias":"n"},{"name":"task_unknown_error","alias":"e"},{"name":"task_already_running","alias":"r"}]','per_min($s)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as success | per_min($b)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as broken | per_min($m)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as missing_dependency | per_min($n)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as not_found | per_min($r)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as already_running | per_min($e)/(per_min($s) + per_min($b) + per_min($m) + per_min($n) + per_min($e)+  per_min($r)) as unknown_error','{"already_running":{"unit":"percents"},"broken":{"unit":"percents"},"missing_dependency":{"unit":"percents"},"not_found":{"unit":"percents"},"success":{"unit":"percents"},"unknown_error":{"unit":"percents"}}');
INSERT INTO dash_entries VALUES(319,18,4,'Worker Parallelism','Number of workers executing tasks in parallel.',6,'line','[{"name":"snoop.data.tasks.call_function__duration","alias":"call_function__duration"},{"name":"snoop.data.tasks.run_task__duration","alias":"run_task__duration"},{"name":"snoop.data.tasks.laterz_snoop_task__duration","alias":"laterz_snoop_task__duration"}]','per_min($call_function__duration)/60 as active_in_task | per_min($run_task__duration)/60 as including_run_loop | per_sec($laterz_snoop_task__duration) as including_task_locking','{"active_in_task":{"unit":""},"including_run_loop":{"unit":""},"including_task_locking":{"unit":""}}');
