INSERT INTO dash_entries VALUES(323,18,4,'Task Running Overhead Distribution','',0,'stacked-area','[{"name":"snoop.data.tasks.queue_another_task_of_same_type__duration","alias":"queue_another_task_of_same_type__duration"},{"name":"snoop.data.tasks.queue...k_of_a_different_type__duration","alias":"k_of_a_different_type__duration"},{"name":"snoop.data.tasks.task_fetch_lock_object__duration","alias":"task_fetch_lock_object__duration"},{"name":"snoop.data.tasks.task_fetch_mark_started__duration","alias":"task_fetch_mark_started__duration"},{"name":"snoop.data.tasks.laterz_snoop_task__duration","alias":"laterz_snoop_task__duration"},{"name":"snoop.data.tasks.call_function__duration","alias":"call_function__duration"}]','per_sec($queue_another_task_of_same_type__duration) /(per_sec($laterz_snoop_task__duration) - per_sec($call_function__duration)) as another_task_same_type | per_sec($k_of_a_different_type__duration) /(per_sec($laterz_snoop_task__duration) - per_sec($call_function__duration)) as another_task_diff_type | per_sec($task_fetch_lock_object__duration) /(per_sec($laterz_snoop_task__duration) - per_sec($call_function__duration)) as fetch_and_lock | per_sec($task_fetch_mark_started__duration) /(per_sec($laterz_snoop_task__duration) - per_sec($call_function__duration)) as fetch_and_set_started','{"another_task_diff_type":{"unit":"percents"},"another_task_same_type":{"unit":"percents"},"fetch_and_lock":{"unit":"percents"},"fetch_and_set_started":{"unit":"percents"}}');
